import React from 'react';
import './style.css';
import Card from './Card'

class Cards extends React.Component {
  render() {
    const startups = this.props.cards;
    console.log(startups)
    return (
      <div>
        {
          startups.map((startup, key) => {
            return (<Card item={key} />)
          }
          )
        }
      </div>

    );
  }
}

export default Cards;
